INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 0, 0, 0, "お！\nあそこに困ってそうな人発見！", 1, 0, 1001, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 2, "春咲 ひより", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "みんなみたいに\nわたしも強くならなきゃ", 1, 0, 0, 0, "大切な人を\n守れるようになりたい…って", 1, 0, 1002, "わ、わたし、\nなに言ってるんだろ\nあはは…", 2, "草野 優衣", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "フェンシングを始めてみては？", 1, 0, 0, 0, "キミに必要な集中力と感性が", 1, 0, 1003, "少しは磨かれると思いますよ。", 2, "士条 怜", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "ねぇ、にいちゃん！", 1, 0, 0, 0, "今日はなにして遊ぶ？", 1, 0, 1004, "みそぎはねぇ、\nかくれんぼやりたい！", 2, "穂高 みそぎ", 1.5, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "風宮あかりです", 1, 0, 0, 0, "ねぇ…", 1, 0, 1006, "私といっしょに…\nいかない？", 2, "風宮 あかり", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "出雲宮子なのー", 1, 0, 0, 0, "プリンたべたいのー", 1, 0, 1007, "食べ物の恨みは怖いのー", 2, "出雲 宮子", 1.5, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "ボクは虹村雪。", 1, 0, 0, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 1, 0, 1008, "いいよ。\n見られることは運命さ…", 2, "虹村 雪", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "フッ…聞いて後悔するがいい！", 1, 0, 0, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, 0, 1009, "人呼んで「疾風の冥姫」!!", 2, "柊杏奈", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "マホマホ王国のプリンセス、\nまほ姫どす", 1, 0, 0, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, 0, 1010, "ほんまおおきにやわ～♪", 2, "姫宮 真歩", 1.5, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "衣之咲璃乃です！", 1, 0, 0, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 1, 0, 1011, "ここで会ったが\n100年目～！", 2, "衣之咲 璃乃", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 0, 0, 0, "ち、超能力って…\n何のことかな～？", 1, 0, 1012, "…って、お願い！\n誰にも言わないでおいて～！", 2, "柏崎 初音", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "ちょす！\n美波鈴奈だよ～♪", 1, 0, 0, 0, "一応カリスマ読モJKやってまっす！", 1, 0, 1016, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 2, "美波 鈴奈", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "はいたーい。\n喜屋武香織さー。", 1, 0, 0, 0, "東京は遊園地みたいなところさー", 1, 0, 1017, "でも、沖縄もとってもいいとこさー", 2, "喜屋武 香織", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "支倉伊緒です。", 1, 0, 0, 0, "先生って呼ばれるのは\nくすぐったいから", 1, 0, 1018, "イオちゃんって呼んでね。", 2, "支倉 伊緒", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 0, 0, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 1, 0, 1020, "ミミをおいてかないでぇ～", 2, "茜 ミミ", 1.5, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 0, 0, 0, "あの……\nふぇ……", 1, 0, 1021, "ふぇぇぇぇぇん……", 2, "栗林 くるみ", 1.5, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "風宮よりです。\nあああああ！", 1, 0, 0, 0, "こんな私に貴重な時間を\n割いていただき、", 1, 0, 1022, "なんてありがとうございます！", 2, "風宮 より", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 0, 0, 0, "おにいちゃんどこいくの？\nえ？", 1, 0, 1023, "私こっち行きたいー\nね、早く早くー", 2, "北条 綾音", 1.5, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "わっ…わっ…私、\n天野すずめといいます！", 1, 0, 0, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 1, 0, 1025, "これて何か違う…\nあああすみません！", 2, "天野 すずめ", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "……クスクス…私は\n…倉石恵理子……", 1, 0, 0, 0, "あなたは…運命の……\n伴侶……", 1, 0, 1027, "離しませんわ………\n絶対に…!!", 2, "倉石 恵理子", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 0, 0, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, 0, 1028, "…そうでしょ？？", 2, "佐々木 咲恋", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "桜井望だよ！\nよろしくねっ", 1, 0, 0, 0, "ぇっと…\nキミ、私のこと知らないの?!", 1, 0, 1029, "あはは、\n私もまだまだだなぁ～", 2, "桜井 望", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "デケデケデンっ！", 1, 0, 0, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 1, 0, 1030, "ショーグン、\nワタシと一緒に天下統一デース！", 2, "ニノン・ジュベール", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "上喜しのぶです。\n手元のドクロが父です。", 1, 0, 0, 0, "でもって私の隣にいるのが……\nえ、見えない？", 1, 0, 1031, "おかしいですね……", 2, "上喜 しのぶ", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "目指すはビッグな\nお笑い芸人だっぺ！", 1, 0, 0, 0, "けんども\nそれには足りないモンが…", 1, 0, 1033, "そう、\nオラのボケに突っ込める相方が…！", 2, "野戸まひる", 1.5, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, 0, 0, 0, "ちょっと緊張しちゃって…", 1, 0, 1034, "ちょ\nちょっと一杯飲んできます…！", 2, "綾瀬 ゆかり", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "氷川鏡華…です", 1, 0, 0, 0, "知らない人とは話しちゃいけないので", 1, 0, 1036, "これ以上お話しすることは…\nないです！", 2, "氷川 鏡華", 1.5, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "柏崎…栞です。", 1, 0, 0, 0, "……あ、アラーム。", 1, 0, 1038, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 2, "柏崎 栞", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "ふ、双葉碧です。", 1, 0, 0, 0, "私、一人も友達がいなくて……", 1, 0, 1040, "野に咲く花が、\n唯一の話相手です。", 2, "双葉 碧", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "三角千歌です。", 1, 0, 0, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, 0, 1042, "そう思っています。", 2, "三角 千歌", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "安芸真琴だ。", 1, 0, 0, 0, "あぁ？\nお前のそいつの仲間か？", 1, 0, 1043, "う、疑ってすまなかったな…", 2, "安芸 真琴", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "わらわこそは夜を総べる者！", 1, 0, 0, 0, "生けとし生ける全ての者よ！", 1, 0, 1044, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 2, "イリヤ・オーンスタイン", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "そこで騎士は妖精を乱暴に……", 1, 0, 0, 0, "ぐふふふふ……はっ！", 1, 0, 1045, "ｌク、クウカに何かご用ですか!?", 2, "遠見 空花", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, 0, 0, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, 0, 1046, "う～ん…\n猫ってホントに最高にゃ～♪", 2, "宮坂たまき", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "大神美冬よ！", 1, 0, 0, 0, "それでは早速クエストに…", 1, 0, 1048, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 2, "大神 美冬", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "星野静流だよ！", 1, 0, 0, 0, "クエストもバトルも\n掃除も洗濯も", 1, 0, 1049, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 2, "星野静流", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "アタシは玉泉美咲。", 1, 0, 0, 0, "見ての通りの\nセクシー美少女で", 1, 0, 1050, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 2, "玉泉美咲", 1.5, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "？？？", 1, 0, 0, 0, "？？？？", 1, 0, 1052, "？？？？", 2, "リマ", 1.4, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "モニカ・ヴァイスヴィントだ。", 1, 0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 0, 1053, "そ、そこまでいうなら\nもらってやる", 2, "モニカ・ヴァイスヴィント", 1.5, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "モニカ・ヴァイスヴィントだ。", 1, 0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 0, 1058, "そ、そこまでいうなら\nもらってやる", 2, "ペコリーヌ", 1.5, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "モニカ・ヴァイスヴィントだ。", 1, 0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 0, 1059, "そ、そこまでいうなら\nもらってやる", 2, "コッコロ", 1.5, 0);
INSERT INTO `v1_9fdf48ac90b19d0f4c2477b113765e38af0cdeb2a93ecf084cc2b3f768db2786` VALUES (1, "モニカ・ヴァイスヴィントだ。", 1, 0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 0, 1060, "そ、そこまでいうなら\nもらってやる", 2, "キャル", 1.5, 0);
